import React from 'react'




export default class CadastroUsuarios extends React.Component {
  state = {
    nome: "",
    email: "",
  }

  handleNome = (event) => {
    this.state({ nome: event.target.value })
  }

  handleEmail = (event) => {
    this.state({ email: event.target.value })
  }

  apertandoCadastrar = () => {
    console.log(this.state)
  }

  render() {
    return (
      <div>
        CadastroUsuarios
        <br />
        <hr />
        <button onClick={this.props.vaiParaLista}>Ir Para Lista de Usu√°rios</button>
        <br />
        <h2>Cadastro</h2>

        <input
          placeholder={"Nome"}
          value={this.state.nome}
          onChange={this.handleNome}
        />
        <input
          placeholder={"E-mail"}
          value={this.state.email}
          onChange={this.handleEmail}
        />
        <button onClick={this.apertandoCadastrar}>Cadastrar</button>
      </div>
    )
  }
}
